YUI.add("gallery-math",function(a){a.mix(Math,{add:function(){var b=0;a.Array.each(arguments,function(c){if(a.Lang.isArray(c)){c=Math.add.apply(this,c);}b+=c;});return b;},multiply:function(){var b=1;a.Array.each(arguments,function(c){if(a.Lang.isArray(c)){c=Math.multiply.apply(this,c);}b*=c;});return b;},degreesToRadians:function(b){return b*Math.PI/180;},radiansToDegrees:function(b){return b*180/Math.PI;},acosh:function(b){return Math.log(b+Math.sqrt(b*b-1));},asinh:function(b){return Math.log(b+Math.sqrt(b*b+1));},atanh:function(b){return Math.log((1+b)/(1-b))/2;},cosh:function(b){var c=Math.exp(b);return(c+1/c)/2;},sinh:function(b){var c=Math.exp(b);return(c-1/c)/2;},tanh:function(b){var c=Math.exp(2*b);return(c-1)/(c+1);},parallel:function(c,b){return c*b/(c+b);}});},"@VERSION@");